<h4>sequence.Instantiated?</h4>

<pre>() => true or false</pre>

<p>Returns true if the sequence has been instantiated.</p>

<p><b>Note</b>: This is primarily for debugging, it should not be used in regular code.</p>

<p>See also: <a href="sequence.Instantiate.html">sequence.Instantiate</a>, <a href="../../Basic Data Types/Sequence.html">Sequence</a></p>
